import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo Blog</h1>
      <div className="links">
        <Link to="/studentList">List of Students</Link>
        <Link to="/createStudent">Add Student</Link>
      </div>
    </nav>
  );
}

export default Navbar;
